import React, { Component } from 'react'
import MuiThemeProvider from '@material-ui/core/styles/MuiThemeProvider';
import { createMuiTheme } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core//Typography'
import red from '@material-ui/core/colors/red'
import { List, ListItem } from '@material-ui/core/List'

const styles = {
    button: {
        margin: 15,
    },
};


const theme = createMuiTheme({
    palette: {
        primary: {
            main: red['A700']
        },
        secondary: {
            main: red[900]
        }
    }
});

export class Confirm extends Component {
    render() {
        return (
            <MuiThemeProvider theme={theme}>
                <React.Fragment>
                    <AppBar position="static" color="primary" >
                        <Toolbar >
                            <Typography variant="h5">
                                WebMenu
                            </Typography>
                        </Toolbar>
                    </AppBar>
                    <br />
                    <List>
                        <ListItem
                            primaryText="Nome de usuário"
                            secondaryText={user}
                        />
                        <ListItem
                            primaryText="Senha"
                            secondaryText={password}
                        />
                        <ListItem
                            primaryText="Email"
                            secondaryText={email}
                        />
                        <ListItem
                            primaryText="Estabelecimento"
                            secondaryText={placeName}
                        />
                        <ListItem
                            primaryText="Descrição do estabelecimento"
                            secondaryText={placeDescription}
                        />
                        <ListItem
                            primaryText="Telefone"
                            secondaryText={placePhone}
                        />
                    </List>
                </React.Fragment>

            </MuiThemeProvider>
        )
    }
}

export default Confirm
